leuk

met Jack Black, Emily Blunt en Jason Segel

Lemuel Gulliver (Jack Black), een bezielde reisjournalist, krijgt een opdracht die hem in de bermuda driehoek brengt. Wanneer 
zijn schip vergaat vindt hij zichzelf aangespoeld op het verborgen eiland Lilliput, waar hele kleine mensjes wonen.
